import React from 'react';
import { LineChart, Line } from 'recharts';

type Game = {
  gameId: string,
  passingAttemptsAmt: number,
  passingCompletionsAmt: number,
  seasonYear: number
}

type PlayerDashboardGamePerformanceLineChartProps = {
  data: Game[]
}

export default ({ data }: PlayerDashboardGamePerformanceLineChartProps) => {
  const lineChartDatapoints = data.map((g: Game) => ({
    x: g.gameId,
    y: g.passingCompletionsAmt / g.passingAttemptsAmt
  }));

  const lineChartData = {
    color: "steelblue",
    points: lineChartDatapoints
  }

  return (
    <LineChart data={lineChartData} />
  )
}
